import React, { useContext } from 'react';
import './CartItems.css';
import { ShopContext } from '../../Context/ShopContext';
import remove_icon from '../Assets/cart_cross_icon.png';

const CartItems = () => {
  const { getTotalCartAmount, products, cartItems, removeFromCart } = useContext(ShopContext);

  const handleImageError = (e) => {
    e.target.src = '/products/default-image.jpg'; // Path to a default image
  };

  return (
    <div className='cartitems'>
      <div className="cartitems-format-main">
        <p>Products</p>
        <p>Title</p>
        <p>Price</p>
        <p>Quantity</p>
        <p>Total</p>
        <p>Remove</p>
      </div>
      <hr />
      {products.length > 0 && Object.keys(cartItems).length > 0 ? (
        products.map((product) => {
          if (cartItems[product._id] > 0) {
            return (
              <div key={product._id}>
                <div className="cartitems-format cartitems-format-main">
                  <img
                    src={`/products/${product.image}`}
                    alt={product.name}
                    className='carticon-product-icon'
                    onError={handleImageError}
                  />
                  <p>{product.name}</p>
                  <p>${product.new_price.toFixed(2)}</p>
                  <button className='cartitems-quantity'>{cartItems[product._id]}</button>
                  <p>${(product.new_price * cartItems[product._id]).toFixed(2)}</p>
                  <img 
                    className='cartitems-remove-icon' 
                    src={remove_icon} 
                    onClick={() => removeFromCart(product._id)} 
                    alt="Remove" 
                  />
                </div>
                <hr />
              </div>
            );
          }
          return null;
        })
      ) : (
        <p>Your cart is empty.</p>
      )}
      <div className="cartitems-down">
        <div className="cartitems-total">
          <h1>Cart Totals</h1>
          <div>
            <div className="cartitems-total-item">
              <p>Subtotal</p>
              <p>${getTotalCartAmount().toFixed(2)}</p>
            </div>
            <hr />
            <div className="cartitems-total-item">
              <p>Shipping Fee</p>
              <p>Free</p>
            </div>
            <hr />
            <div className="cartitems-total-item">
              <h3>Total</h3>
              <h3>${getTotalCartAmount().toFixed(2)}</h3>
            </div>
          </div>
          <button>PROCEED TO CHECKOUT</button>
        </div>
        <div className="cartitems-promocode">
          <p>If you have a promo code, enter it here</p>
          <div className="cartitems-promobox">
            <input type="text" placeholder='Promo code' />
            <button>Submit</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CartItems;
